import { LButton } from './Button.styled';
import PropTypes from 'prop-types';

export const Button = ({ onClick, dis }) => {
  return (
    <LButton onClick={onClick} type="button" dis>
      Load more
    </LButton>
  );
};

Button.propTypes = {
  onClick: PropTypes.func.isRequired,
};
